// â”€â”€ init-cg-feature-examples.js â”€â”€
/**
 * - Initializes and manages the feature examples visualization component.
 * - This component is designed to display detailed information about a specific feature
 *   from a machine learning model, including its top activating tokens, activation.
 *   histograms, and example sequences where the feature is active.
 * - Key functionalities:
 *   - Sets up the main container and sub-sections for logits, histograms, and example lists.
 *   - Provides functions to load feature data (`loadFeature`) and render it (`renderFeature`).
 *   - Initializes and renders Plotly histograms for feature activations and logit effects.
 *   - Displays lists of example sequences, highlighting token activations and logit effects.
 *   - Handles merging of hex-escaped byte tokens for correct display.
 *   - Implements interactive elements, such as hover effects on tokens to show their
 *     values on histograms.
 * 
 * @param {{containerSel: !d3.selection, showLogits: boolean, showExamples: boolean, hideStaleOutputs: boolean}} options
 *   - containerSel: The d3 selection for the container element.
 *   - showLogits: Whether to show the logits section.
 *   - showExamples: Whether to show the examples section.
 *   - hideStaleOutputs: Whether to hide stale outputs.
 * @return {{loadFeature: function(), renderFeature: function()}}
 */
window.initFeatureExamples = function({containerSel, showLogits=true, showExamples=true, hideStaleOutputs=false}){
  const visState = {
    isDev: 0,
    showLogits,
    showExamples,
    hideStaleOutputs,

    activeToken: null,
    feature: null,
    layer: null,
    featureIndex: -1,

    // chartRowTop and chartRowHeight are likely intended for layout calculations,
    // though they are not used in the provided snippet. They might be remnants
    // of a previous layout system or planned for future use.
    chartRowTop: 16,
    chartRowHeight: 82,
  };

  const sel = containerSel.html('').append('div.feature-examples');
  if (visState.showLogits) sel.append('div.feature-example-logits');
  if (visState.showExamples && visState.showLogits) sel.append('div.feature-example-histograms');
  if (visState.showExamples) sel.append('div.feature-example-list');

  // util.initRenderAll is a utility to manage rendering functions.
  // It ensures that all registered rendering functions for 'feature' are called when renderAll.feature() is invoked.
  const renderAll = util.initRenderAll(['feature']);

  if (visState.showLogits) initFeatureExamplesLogits({renderAll, visState, sel});
  if (visState.showExamples && visState.showLogits) initFeatureExamplesHistograms({renderAll, visState, sel});
  if (visState.showExamples) initFeatureExamplesList({renderAll, visState, sel});

  return {loadFeature, renderFeature};

  // Asynchronously renders the details for a given feature.
  // It first loads the feature data and then, if the featureIndex hasn't changed
  // in the meantime (e.g., due to a new user interaction), it updates the vis
  // state & triggers a full re-render of all components.
  async function renderFeature(scan, layer, featureIndex){
    if (visState.hideStaleOutputs) sel.classed('is-stale-output', 1);

    // Update the visualization state with the new feature index and layer.
    visState.featureIndex = featureIndex;
    visState.layer = layer;

    // Load the feature data. This might involve fetching data if not already cached.
    const feature = loadFeature(scan, layer, featureIndex);

    // Check if the loaded feature is still the one we want to display.
    // This prevents race conditions if the user quickly selects different features.
    if (feature.featureIndex == visState.featureIndex){
      visState.feature = feature;
      renderAll.feature(); // Trigger re-render of all feature-related components.
      if (visState.hideStaleOutputs) sel.classed('is-stale-output', 0);
    }

    return feature;
  }

  // Loads and prepares data for a specific feature.
  // This retrieves raw feature data (assumed to be globally available in `window.featureData`)
  // and augments it with scales for visualization (e.g., color scales for activations).
  function loadFeature(scan, layer, featureIndex){

    // TODO(mcdougallc) - index `featureData` by scan too
    // is populated elsewhere with data indexed by a composite key of layer and featureIndex.
    const feature = window.featureData[`${layer}_${featureIndex}`];

    // Background color scale for activations: orange for most strongly active features.
    feature.bgColorScale = d3.scaleSequential(d3.interpolateOranges)
      .domain([0, 1.4]).clamp(1);

    // Logit underline effects: blue for positive (boosting correct token), red for negative (suppressing).
    feature.uColorScale = d3.scaleLinear()
      .domain([-1, 0, 1])
      .range(["rgb(255,0,0)", "rgb(255,255,255)", "rgb(0,0,255)"])
      .clamp(true);

    feature.featureIndex = featureIndex;
    feature.scan = scan;
    return feature;
  }

  /**
   * Initializes the section displaying the top and bottom activating tokens for the feature.
   * These tokens, when hovered, will highlight their corresponding values on the
   * logits histogram, providing a direct link between specific inputs/outputs and their
   * overall distribution.
   */
  function initFeatureExamplesLogits({renderAll, visState, sel}) {

    // Register a function to be called whenever the feature data changes.
    renderAll.feature.fns.push(async () => {
      // TODO(mcdougallc) - rename these to `top_tokens` and `top_logits`, or at least `top_logit_tokens` and `top_logit_values`
      let { top_logits, bottom_logits, top_logit_values, bottom_logit_values } = visState.feature;
      if (!top_logits?.length && !bottom_logits?.length) return;

      const containerSel = sel.select('.feature-example-logits').html('');
      containerSel.append('div.section-title').text('TOP INPUTS / OUTPUTS');

      // Get data for top & bottom logit rows
      const rowsData = [
        { name: 'Top', tokens: top_logits, logits: top_logit_values },
        { name: 'Bottom', tokens: bottom_logits, logits: bottom_logit_values }
      ];

      for (let { name, tokens, logits } of rowsData) {
        if (!tokens?.length || !logits?.length) continue;
        const data = tokens.map((token, index) => {
          return { token: token, logit: logits[index] };
        });

        const row = containerSel.append('div.ctx-container');
        row.append('div.logit-label').text(name);

        // For both our rows, we add all that row's tokens (with hover names & handlers to add hist vlines)
        row.appendMany('span.token', data)
           .text(d => d.token)
           .attr('title', d => `token: ${d.token}
logit ${d.logit}`)
           .on('mouseover', (evt, d) => addLineHistogram(`logits-hist`, d.token, d.logit))
           .on('mouseout', (evt, d) => removeLineHistogram(`logits-hist`));
      }
    });
  }

  /**
   * Initializes the Plotly histograms for visualizing feature activations ("acts")
   * and logit effects ("logits"). These histograms provide a distributional view
   * of how the feature responds across different inputs and its impact on model outputs.
   */
  function initFeatureExamplesHistograms({renderAll, visState, sel}) {

    // Register a function to be called whenever the feature data changes.
    renderAll.feature.fns.push(async () => {
      // Clear previous histograms and set up containers for new ones.
      // It creates two divs, one for "acts-hist" and one for "logits-hist".
      sel.select('.feature-example-histograms').html('')
        .append('div.histogram-container')
        .selectAll('div.plotly-hist')
        // Data-binding for the two histogram types.
        .data(["acts", "logits"])
        .enter()
        .append('div')
        .attr('class', 'plotly-hist')
        .attr('id', d => `${d}-hist`)
        .each((histKey, i, nodes) => {
          const histData = visState.feature[`${histKey}_hist`];
          // For each histogram type, retrieve its data from the feature object
          // and call setupHistogram to render it.
          setupHistogram(histData, histKey);
        }
      );
    });
  }

  // TODO(mcdougallc) - nest these functions in a more natural way (ask Gemini?)

  /**
   * Initializes the list of feature examples. This section displays sequences
   * where the feature is active, showing the context tokens and highlighting
   * activations and logit effects..
   */
  function initFeatureExamplesList({renderAll, visState, sel}){
    const innerSel = sel.select('.feature-example-list');
    renderAll.feature.fns.push(async () => {
      // If the feature is marked as "dead" (e.g., no activations found),
      // display a message and skip rendering examples.
      if (visState.feature.isDead) return innerSel.html(`Feature ${visState.feature.featureIndex} failed to load`);

      // The examples are structured by quantiles. This prepares the data for rendering.
      const cols = [visState.feature.examples_quantiles];
      innerSel.html('')
        // Assumes a two-column layout or a similar structure.
        .appendMany('div.example-2-col', cols)
        .appendMany('div', d => d)
        // Call drawQuantile for each quantile data object.
        .each(drawQuantile);
    });

    // Renders all examples within a given quantile, by calling drawExample for each example sequence.
    function drawQuantile(quantile){
      const sel = d3.select(this);

      sel.append('div.example-quantile')
        .append('span.quantile-title').text(quantile.quantile_name + ' ');

      sel.appendMany('div.ctx-container', quantile.examples).each(drawExample);
    }
  
    // Converts a single token into a string token, dealing with messy cases where
    // the token is a hex-escaped sequence of bytes, e.g. `\x00\x01\x02`.
    function maybeHexEscapedToBytes(token) {
      let ret = [];
      while (token.length) {
        if (/^\\x[0-9a-f]{2}/.exec(token)) {
          ret.push(parseInt(token.slice(2, 4), 16));
          token = token.slice(4);
        } else {
          ret.push(...new TextEncoder().encode(token[0]));
          token = token.slice(1);
        }
      }
      return ret;
    }

    // Merges tokens that are hex-escaped sequences of bytes into a single token.
    // Also returns the maximum activation seen for the merged tokens.
    function mergeHexEscapedMax(tokens, acts, actsRaw, logitEffects, rawLogits) {
      let ret = [];
      let i = 0;
      while (i < tokens.length) {
        let maxAct = acts[i];
        let maxActRaw = actsRaw[i];
        let maxLogitEffect = logitEffects[i];
        let maxRawLogit = rawLogits[i];
        let pushedMerge = false;

        if (/\\x[0-9a-f]{2}/.exec(tokens[i])) {
          // Check if the current token is a hex-escaped byte.
          let buf = maybeHexEscapedToBytes(tokens[i]);
          // Start buffer with current token's bytes.
          // Try to merge with subsequent tokens (up to 4 more) if they form a valid UTF-8 sequence.
          for (let j = i + 1; j < Math.min(i + 5, tokens.length); j++) {
            // Update max values from the tokens being considered for merging.
            maxAct = Math.max(maxAct, acts[j]);
            maxActRaw = Math.max(maxActRaw, actsRaw[j]);
            maxLogitEffect = Math.max(maxLogitEffect, logitEffects[j]);
            maxRawLogit = Math.max(maxRawLogit, rawLogits[j]);
            buf.push(...maybeHexEscapedToBytes(tokens[j]));
            // Add next token's bytes to buffer.
            try {
              // Attempt to decode the accumulated bytes as a UTF-8 string.
              // { fatal: true } ensures an error is thrown for invalid sequences.
              let text = new TextDecoder("utf-8", { fatal: true }).decode(new Uint8Array(buf));
              // If successful, push the merged token and its associated max values.
              ret.push({token: text, act: maxAct, actRaw: maxActRaw, logitEffect: maxLogitEffect, rawLogit: maxRawLogit, minIndex: i, maxIndex: j});
              // Move index past the merged tokens.
              i = j + 1;
              pushedMerge = true;
              // Stop trying to merge further for this sequence.
              break;
            } catch (e) {
              // If decoding fails, it means the current byte sequence is not valid UTF-8.
              // Continue to add more bytes if available.
              continue;
            }
          }
        }
        // If no merge occurred (either not a hex token or merging failed/wasn't attempted),
        // push the current token as is.
        if (!pushedMerge) {
          ret.push({token: tokens[i], act: acts[i], actRaw: actsRaw[i], logitEffect: logitEffects[i], rawLogit: rawLogits[i], minIndex: i, maxIndex: i});
          i++;
        }
      }
      return ret;
    }

    /**
     * Renders a single example sequence, each one containing multiple tokens,
     * their activations, and logit effects.
     */
    function drawExample(exp){
      const sel = d3.select(this).append('div')
        .st({opacity: exp.is_repeated_datapoint ? .4 : 1});
      const textSel = sel.append('div.text-wrapper');

      // TODO(mcdougallc) - simplify so we don't need acts and acts raw? 
      const tokenData = mergeHexEscapedMax(
        exp.tokens,
        exp.tokens_acts_list,
        exp.tokens_acts_list_raw,
        exp.tokens_logits_list,
        exp.tokens_raw_logits_list
      );

      // Create a span for each processed token, with text & hoverinfo.
      const tokenSel = textSel.appendMany('span.token', tokenData)
          .text(d => d.token)
          .at({title: d => `token '${d.token}'
act: ${d.actRaw}
raw logit: ${d.rawLogit}
logit effect: ${d.logitEffect}` });

      // Set token border & background color according to activation and logit effect respectively.
      tokenSel.filter(d => d.act || d.logitEffect)
          .st({
              "background": d => visState.feature.bgColorScale(d.act),
              "border-bottom": d => `2px solid ${visState.feature.uColorScale(d.logitEffect)}`
          });

      // Add lines to histograms on hover.
      tokenSel
          .on('mouseover', (evt, d) => {
            addLineHistogram(`logits-hist`, d.token, d.rawLogit);
            if (d.act) addLineHistogram(`acts-hist`, d.token, d.actRaw);
          })
          .on('mouseout', (evt, d) => {
            removeLineHistogram(`logits-hist`);
            if (d.act) removeLineHistogram(`acts-hist`);
          });

      // Identify the "training token" if specified in the example data, and bold it (plus
      // center the text container on it).
      const centerNode = tokenSel
          .filter(d => exp.train_token_ind != null && d.minIndex <= exp.train_token_ind && exp.train_token_ind <= d.maxIndex)
          .classed('train_token_ind', 1)
          .node();

      if (!centerNode) return;
      const leftOffset = (sel.node().offsetWidth - centerNode.offsetWidth)/2 - centerNode.offsetLeft;
      textSel.translate([leftOffset, 0]);
    }
  }

  /**
   * Sets up and renders a Plotly histogram for either activations or logits.
   * This includes configuring layour, traces (data series) and creating the Plotly
   * chart in the designated div.
   */
  function setupHistogram(histData, histKey) {
    // We style logits differently (rdbu color scheme rather than orange, also different x-axis range).
    logitHist = histKey == "logits";
      
    const layout = {
      xaxis: {
        gridcolor: '#eee',
        zerolinecolor: '#eee',
        tickvals: histData.ticks,
        range: [logitHist ? 1.2 * Math.min(...histData.x) : 0.0, 1.2 * Math.max(...histData.x)],
        tickfont: {size: 10},
      },
      yaxis: {
        gridcolor: '#eee',
        zerolinecolor: '#eee',
        tickfont: {size: 10},
      },
      barmode: 'relative',
      bargap: 0.01,
      showlegend: false,
      margin: {l: 30, r: 20, b: 50, t: 0, pad: 4},
      paper_bgcolor: 'white',
      plot_bgcolor: 'white',
      paper_bgcolor: 'rgba(0,0,0,0)',
      plot_bgcolor: 'rgba(0,0,0,0)',
      responsive: true,
      height: 125,
      // Initial invisible shape and annotation, made visible on hover events (their
      // x and y coords will be updated dynamically).
      shapes: [{
        type: 'line',
        line: {color: 'black', width: 1},
        x0: 0,
        x1: 0,
        xref: 'x',
        y0: 0,
        y1: 0.9,
        yref: 'paper',
        visible: false,
      }],
      annotations: [{
        text: '',
        showarrow: false,
        x: 0,
        xref: 'x',
        y: 0.9,
        yref: 'paper',
        xshift: 3,
        align: 'left',
        xanchor: 'left',
        font: {size: 10},
        visible: false,
      }],
    };

    // TODO(mcdougallc) - use this same method / functions to simplify sae_vis init.js
    const traces = [
      {
        x: histData.x.filter(value => value >= 0),
        y: histData.y.filter((_, i) => histData.x[i] >= 0),
        type: 'bar',
        marker: {color: logitHist
          ? 'rgba(0,0,255,0.5)'
          : histData.x.map(v => visState.feature.bgColorScale((0.4 + 0.6 * v / Math.max(...histData.x)), 1))}
      },
      {
        x: histData.x.filter(value => value < 0),
        y: histData.y.filter((_, i) => histData.x[i] < 0),
        type: 'bar',
        marker: {color: logitHist
          ? 'rgba(255,0,0,0.5)'
          : histData.x.map(v => visState.feature.bgColorScale((0.4 + 0.6 * v / Math.max(...histData.x)), 1))}
      }
    ];

    // Create the new Plotly chart in the designated div, and maybe add a title.
    Plotly.newPlot(`${histKey}-hist`, traces, layout, {responsive: true, displayModeBar: false});

    if (histData.title) {
      d3.select(`#${histKey}-hist`)
        .insert('div', ':first-child')
        .attr('class', 'section-title no-border')
        .html(histData.title);
    }
  }

  /**
   * Updates a Plotly histogram to show a vertical line and an annotation at a given x-value.
   * This is typically called during mouseover of a token to highlight its corresponding value.
   */
  function addLineHistogram(histogramID, tok, xValue=0.0) {    
    const graph = d3.select(`#${histogramID}`).node();
    // Determine if the xValue is to the right or left of the histogram's midpoint.
    // This is used to adjust the annotation's alignment (xanchor) so it doesn't go off-screen.
    const data = graph?.data[0];
    const midPoint = data?.x ? (Math.max(...data.x) + Math.min(...data.x)) / 2 : 0;
    const isRight = xValue > midPoint;

    // Use Plotly.relayout to update the existing histogram's layout.
    // This is more efficient than redrawing the entire chart.
    Plotly.relayout(histogramID, {
      [`shapes[0].x0`]: xValue, // Set line's start x-coordinate.
      [`shapes[0].x1`]: xValue, // Set line's end x-coordinate.
      [`shapes[0].visible`]: true, // Make the line visible.
      [`annotations[0].x`]: xValue, // Set annotation's x-coordinate.
      [`shapes[0].x0`]: xValue,
      [`shapes[0].x1`]: xValue,
      [`shapes[0].visible`]: true,
      [`annotations[0].x`]: xValue,
      [`annotations[0].text`]: `|${tok}|<br>${xValue.toFixed(3)}`,
      [`annotations[0].visible`]: true,      
      [`annotations[0].align`]: isRight ? 'right' : 'left',
      // Adjust alignment and anchor based on whether the value is on the right/left side.
      [`annotations[0].xanchor`]: isRight ? 'right' : 'left',
      // Shift annotation slightly for better visibility.
      [`annotations[0].xshift`]: isRight ? -5 : 0,
    });
  }

  /**
   * Hides the line and annotation in a Plotly histogram.
   */
  function removeLineHistogram(histogramID) {
    Plotly.relayout(histogramID, {
      [`shapes[0].visible`]: false,
      [`annotations[0].visible`]: false,
    });
  }

};

// â”€â”€ init-cg-feature-scatter.js â”€â”€
/**
 * - Initializes an interactive scatter plot visualizing relationships between different
 *   numerical attributes of control graph nodes (features).
 * - Allows users to select which attributes to plot on the X and Y axes via dropdown menus.
 * - Displays nodes as text labels, colored and styled based on their type and interaction 
 *   state (hovered, clicked, pinned).
 * - Integrates with the main `visState` and rendering loop (`renderAll`) for consistent 
 *   styling and updates.
 * - Handles dynamic resizing of the plot.
 *
 * @param {!Object} options - Input configuration.
 * @return {!Object} - Output (though the function primarily modifies the DOM and state).
 */
window.initCgFeatureScatter = function({visState, renderAll, data, cgSel}){
  // possible improvements:
  // - persist to url in diff view
  // - support multiple scatter plots
  // - color by x
  // - facet by x
  // - brush to filter
  // - scatter plot of links

  const nodes = data.nodes; //.filter(d => !d.isLogit)

  // Identify all node attributes that are finite numbers and not explicitly skipped.
  // These will be the potential options for the scatter plot axes.
  const numericCols = Object.entries(nodes[0])
    .filter(([k, v]) => typeof v != 'object' && typeof v != 'function' && !utilCg.keysToSkip.has(k) && isFinite(v))
    .map(([k]) => k);

  // Initialize axis keys from URL parameters or use defaults.
  // This allows the scatter plot configuration to be potentially persisted or shared.
  let xKey = util.params.get('feature_scatter_x') || 'ctx_idx';
  let yKey = util.params.get('feature_scatter_y') || 'target_influence';

  // Function to create a dropdown select element for choosing an axis (X or Y).
  function addSelect(isX){
    // For the X-axis, add a special 'Distribution' option which plots nodes
    // sorted first by type, then by the Y-axis value, creating a distribution-like view.
    const options = isX ? ['Distribution'].concat(numericCols) : numericCols;
    selectSel.append('select').st({marginRight: 10})
      .on('change', function(){
        // Update the corresponding key (xKey or yKey) when the selection changes.
        isX ? xKey = options[this.selectedIndex] : yKey = options[this.selectedIndex];
        // Persist the selection to URL parameters.
        isX ? util.params.set('feature_scatter_x', xKey) : util.params.set('feature_scatter_y', yKey);
        // Re-render the plot with the new scales and data mapping.
        renderScales();
      })
      .appendMany('option', options)
      .text(d => d)
      .at({value: d => d})
      // Set the initially selected option based on the current xKey or yKey.
      .filter(d => isX && d == xKey || !isX && d == yKey).at({selected: 'selected'});
  }
    
  // Select the container for the scatter plot, clear any previous content, and
  // add the select elements.
  const sel = cgSel.select('.feature-scatter').html('');
  const selectSel = sel.append('div.select-container').st({marginLeft: 35});
  const chartSel = sel.append('div.chart-container');
  addSelect(1);
  addSelect(0);

  // Main function to render the scatter plot, including axes and nodes.
  // This is called initially and whenever axis selections change or the container resizes.
  function renderScales(){
    // Set up D3 conventions (margins, scales, SVG element).
    const c = d3.conventions({
      sel: chartSel.html('').append('div'),
      margin: {left: 35, bottom: 30, top: 2, right: 6},
    });

    // Handle the special 'Distribution' case for the X-axis.
    // Assigns an index (0 to 1) to each node based on sorting,
    // effectively creating a categorical x-axis spread based on node type and y-value.
    if (xKey == 'Distribution'){
      d3.sort(d3.sort(nodes, d => +d[yKey]), d => d.node_type)
        .forEach((d, i) => d.Distribution = i/nodes.length);
    }

    // Set the domains for the X and Y scales based on the data extents for the selected keys.
    c.x.domain(d3.extent(nodes, d => +d[xKey])).nice();
    c.y.domain(d3.extent(nodes, d => +d[yKey])).nice();

    // Configure and draw the X and Y axes.
    c.yAxis.ticks(3);
    c.xAxis.ticks(5);
    c.drawAxis();
    // Apply ggplot-like styling (grid lines).
    util.ggPlot(c);
    // Add axis labels using the selected keys.
    util.addAxisLabel(c, xKey + ' â†’', yKey + ' â†’', '', 0, 5);

    // Create text elements for each node, positioned according to the selected X & Y values.
    // Uses helper functions for text content, tooltips, and event handling (hover, click).
    const nodeSel = c.svg.appendMany('text.node', nodes)
      .translate(d => [c.x(d[xKey]) ?? -2, c.y(d[yKey]) ?? c.height + 2])
      .text(d => utilCg.featureTypeToText(d.node_type))
      .at({
        fontSize: 7,
        stroke: '#000',
        strokeWidth: .2,
        textAnchor: 'middle',
        dominantBaseline: 'central',
        fill: 'rgba(0,0,0,.1)'
      })
      .call(utilCg.addFeatureTooltip) // Add tooltips showing node details on hover.
      .call(utilCg.addFeatureEvents(visState, renderAll)); // Add click/hover event listeners linked to global state.

    // TODO(mcdougallc) - add hover circle?
    // Apply initial styles (color, opacity) based on node type and global state (hovered, clicked, etc.).
    utilCg.updateFeatureStyles(nodeSel);
    // Register this component's update function with the global renderAll object.
    // This ensures the scatter plot styles are updated whenever the global state changes
    // (e.g., a node is hovered or clicked elsewhere in the application).
    renderAll.hoveredId.fns['featureScatter'] = () => utilCg.updateFeatureStyles(nodeSel);
    renderAll.clickedId.fns['featureScatter'] = () => utilCg.updateFeatureStyles(nodeSel);
    renderAll.pinnedIds.fns['featureScatter'] = () => utilCg.updateFeatureStyles(nodeSel);
    renderAll.hiddenIds.fns['featureScatter'] = () => utilCg.updateFeatureStyles(nodeSel);
  }

  // Initial render call. The check for `!sel.datum().resizeFn` seems like a way
  // to ensure this runs only once during initialization, possibly related to
  // how gridsnap/widgets manage component setup and resizing.
  if (!sel.datum()?.resizeFn) renderScales();
  // Store the renderScales function on the container's datum. This allows
  // external components (like a gridsnap layout manager) to trigger a re-render
  // when the container size changes.
  sel.datum({...(sel.datum() || {}), resizeFn: renderScales});
};

// Ensures initialization runs if this script is loaded directly or dynamically.
window.init?.();

// â”€â”€ init-cg-link-graph.js â”€â”€
/**
 * - Initializes and renders an interactive "link graph" visualization using D3.js.
 * - This graph displays nodes (features, embeddings, logits) across different contexts 
 *   (e.g., token positions) and the attribution edges between them.
 * - Key functionalities include:
 *   - Calculating node positions based on context, stream index, and node density.
 *   - Rendering nodes and links on multiple canvas layers.
 *   - Handling user interactions: hover to highlight nodes and show tooltips, click to 
 *     select/pin nodes.
 *   - Dynamically updating vis after changing `visState` (e.g. pinned nodes, link types).
 *   - Drawing custom X-axis and Y-axis ticks, for prompt tokens and layers/streams.
 *
 * @param {!Object} options - input
 * @return {!Object} - output
 */
window.initCgLinkGraph = function({visState, renderAll, data, cgSel}){
  // TODO(mcdougallc) - rename `links` to `edges`
  const {nodes, links, metadata} = data;

  // The `d3.conventions` plugin sets up a standard structure for D3 visualizations.
  // 'sccccs' defines six layers: one SVG at the bottom, four canvas layers, and one SVG at the top.
  // This layering is for efficient rendering of different visual elements (static vs. dynamic).
  const c = d3.conventions({
    sel: cgSel.select('.link-graph').html(''),
    margin: {left: visState.isHideLayer ? 0 : 30, bottom: 85},
    layers: 'sccccs',
  });
  
  c.svgBot = c.layers[0];
  const allCtx = {
    allLinks: c.layers[1],
    pinnedLinks: c.layers[2],
    bgLinks: c.layers[3],
    clickedLinks: c.layers[4]
  };
  c.svg = c.layers[5];

  // To create a responsive x-axis that adapts to varying numbers of nodes in each context (column),
  // we count the maximum number of nodes per context.
  // `cumsum` (cumulative sum of these maxCounts) helps determine the proportional width each context should occupy.
  const earliestCtxWithNodes = d3.min(nodes, d => d.ctx_idx);
  let cumsum = 0;
  const ctxCounts = d3.range(d3.max(nodes, d => d.ctx_idx) + 1).map(ctx_idx => {
    let maxCount = 0;
    if (ctx_idx >= earliestCtxWithNodes) {
      const group = nodes.filter(d => d.ctx_idx === ctx_idx);
      maxCount = d3.max([1, d3.max(d3.nestBy(group, d => d.streamIdx), e => e.length)]);
      cumsum += maxCount;
    }
    return {ctx_idx, maxCount, cumsum};
  });

  // The x-axis domain is context indices, and the range is based on `cumsum`,
  // making columns with more nodes wider (a polylinear scale).
  const xDomain = [-1].concat(ctxCounts.map(d => d.ctx_idx));
  const xRange = [0].concat(ctxCounts.map(d => d.cumsum * c.width / cumsum));
  c.x = d3.scaleLinear().domain(xDomain.map(d => d + 1)).range(xRange);

  // The y-axis domain is layer indices, and the range is based on the total
  // number of layers (inferred from metadata).
  const nLayers = data.metadata.n_layers;
  const yNumTicks = visState.isHideLayer ? data.byStream.length : nLayers + 2;
  c.y = d3.scaleBand(d3.range(yNumTicks), [c.height, 0]);

  c.yAxis = d3.axisLeft(c.y)
    .tickValues(d3.range(yNumTicks))
    .tickFormat(i => {
      if (i % 2) return;

      return i == nLayers + 1 ? 'Logits' : i == 0 ? 'Emb' : 'L' + i;
      const label = data.byStream[i][0].layerLocationLabel;
      const layer = +label.replace('L', '');
      return isFinite(layer) ? '' : label;
    });

  // Draw background elements (main rect, alternating colored bands for y-axis, horizontal grid lines).
  c.svgBot.append('rect').at({width: c.width, height: c.height, fill: '#F5F4EE'});
  c.svgBot.append('g').appendMany('rect', [0, yNumTicks - 1])
    .at({width: c.width, height: c.y.bandwidth(), y: c.y, fill: '#F0EEE7'});

  c.svgBot.append('g').appendMany('path', d3.range(-1, yNumTicks - 1))
    .translate(d => [0, c.y(d + 1)])
    .at({d: `M0,0H${c.width}`, stroke: 'white', strokeWidth: .5});

  // Draw axes. The default x-axis is removed for custom token labels.
  // Vertical lines from y-axis ticks are also removed.
  c.drawAxis(c.svgBot);
  c.svgBot.select('.x').remove();
  c.svgBot.selectAll('.y line').remove();
  if (visState.isHideLayer) c.svgBot.select('.y').remove();

  // Spread nodes across each context (d.width is the total amount of px space in each column).
  ctxCounts.forEach((d, i) => d.width = c.x(d.ctx_idx + 1) - c.x(ctxCounts[i].ctx_idx));

  // if default to 8px padding right, if pad right to center singletons 
  const padR = Math.min(8, d3.min(ctxCounts.slice(1), d => d.width/2)) + 0;

  // To prevent node cramping, calculate a minimum horizontal spacing (`overallS`).
  // This ensures a minimum separation, even in dense contexts, by finding the tightest ideal spacing
  // across all contexts and ensuring it's at least 20px.
  ctxCounts.forEach(d => d.minS = (d.width - padR)/d.maxCount);
  const overallS = Math.max(20, d3.min(ctxCounts, d => d.minS));

  // Distribute nodes horizontally within their context and stream.
  // Nodes are grouped by `ctx_idx` and `streamIdx`.
  d3.nestBy(nodes, d => [d.ctx_idx, d.streamIdx].join('-')).forEach(ctxLayer => {
    // `ctxWidth` is available horizontal space in the column.
    // `s` is the actual spacing for nodes in this `ctxLayer`, respecting `overallS`.
    const ctxWidth = c.x(ctxLayer[0].ctx_idx + 1) - c.x(ctxLayer[0].ctx_idx) - padR;
    const s = Math.min(overallS, ctxWidth/ctxLayer.length);

    // Nodes within each `ctxLayer` are sorted by `logitPct` to determine their horizontal arrangement.
    // We first sort them, then iterate over them to set their exact horizontal offset.
    ctxLayer = d3.sort(ctxLayer, d => -d.logitPct);
    ctxLayer.forEach((d, i) => {
      d.xOffset = d.node_type === 'logit' ? ctxWidth - (padR/2 + i*s) : ctxWidth - (padR/2 + i*s);
      d.yOffset = 0;
    });
    // // sorting by pinned stacks all the links on top of each other
    // ctxLayer = d3.sort(ctxLayer, d => visState.pinnedIds.includes(d.nodeId) ? -1 : 1)
  });

  // Calculate final screen coordinates (`pos`) for each node.
  nodes.forEach(d => {
    // console.log(`Info for node ${d.nodeId}: d.ctx_idx = ${d.ctx_idx}, d.xOffset = ${d.xOffset}, c.x(d.ctx_idx) = ${c.x(d.ctx_idx)}`);
    d.pos = [
      c.x(d.ctx_idx) + d.xOffset, 
      c.y(d.streamIdx) + c.y.bandwidth()/2 + d.yOffset
    ];
  });


  // Set up mouse event listeners on `c.sel` for hover and click.
  const maxHoverDistance = 30;
  c.sel

    // `mousemove` finds the closest node, and triggers hoverstate if within `maxHoverDistance`. If further
    // away than this, it unhovers the current node (this is the same for `mouseleave`).
    .on('mousemove', (ev) => {
      if (ev.shiftKey) return;
      const [mouseX, mouseY] = d3.pointer(ev);
      const [closestNode, closestDistance] = findClosestPoint(mouseX - c.margin.left, mouseY - c.margin.top, nodes);
      if (closestDistance > maxHoverDistance) {
        utilCg.unHoverFeature(visState, renderAll);
        utilCg.hideTooltip();
      } else if (visState.hoveredId !== closestNode) {
        utilCg.hoverFeature(visState, renderAll, closestNode);
        utilCg.showTooltip(ev, closestNode);
      }
    })
    .on('mouseleave', (ev) => {
      if (ev.shiftKey) return;
      utilCg.unHoverFeature(visState, renderAll);
      utilCg.hideTooltip();
    })

    // `click` triggers a click event on the closest node (if within `maxHoverDistance`), which pins the node
    // to visibility. If not, all nodes are unpinned.
    .on('click', (ev) => {
      const [mouseX, mouseY] = d3.pointer(ev);
      const [closestNode, closestDistance] = findClosestPoint(mouseX - c.margin.left, mouseY - c.margin.top, nodes);
      if (closestDistance > maxHoverDistance) {
        visState.clickedId = null;
        visState.clickedCtxIdx = null;
        renderAll.clickedId();
      } else {
        utilCg.clickFeature(visState, renderAll, closestNode, ev.metaKey || ev.ctrlKey);
      }
    });

  // Helper function to find the closest point to a mouse position.
  function findClosestPoint(mouseX, mouseY, points) {
    if (points.length === 0) return null;

    let closestPoint = points[0];
    let closestDistance = distance(mouseX, mouseY, closestPoint.pos[0], closestPoint.pos[1]);

    for (let i = 1; i < points.length; i++){
      const point = points[i];
      const dist = distance(mouseX, mouseY, point.pos[0], point.pos[1]);
      if (dist < closestDistance){
        closestPoint = point;
        closestDistance = dist;
      }
    }
    return [closestPoint, closestDistance];

    function distance(x1, y1, x2, y2) {
      return Math.sqrt(Math.pow(x2 - x1, 2) + Math.pow(y2 - y1, 2));
    }
  }

  // Create SVG text elements for nodes on the top SVG layer (`c.svg`).
  const nodeSel = c.svg.appendMany('text.node', nodes)
    .translate(d => d.pos)
    .text(d => utilCg.featureTypeToText(d.node_type))
    .at({
      fontSize: 9,
      fill: d => d.nodeColor,
      stroke: '#000',
      strokeWidth: .5,
      textAnchor: 'middle',
      dominantBaseline: 'central',
    });
    // .call(utilCg.addFeatureTooltip)
    // .call(utilCg.addFeatureEvents(visState, renderAll, ev => ev.shiftKey))

  // Create initially hidden SVG circles for nodes on the top SVG layer (`c.svg`).
  const hoverSel = c.svg.appendMany('circle', nodes)
    .translate(d => d.pos)
    .at({r: 6, cy: .5, stroke: '#f0f', strokeWidth: 2, strokeDasharray: '2 2', fill: 'none', display: 'xnone', pointEvents: 'none'});

  // TODO(mcdougallc) - remove this (since it seems the `drawLinks` function makes this redundant).
  links.forEach(d => {
    const [x1, y1] = d.sourceNode.pos;
    const [x2, y2] = d.targetNode.pos;
    d.pathStr = `M${x1},${y1}L${x2},${y2}`;
  });

  /**
   * Draws a given set of links (edges) onto a specified 2D canvas `ctx`.
   */
  function drawLinks(links, ctx, strokeWidthOffset=0, colorOverride){
    ctx.clearRect(-c.margin.left, -c.margin.top, c.totalWidth, c.totalHeight);
    d3.sort(links, d => d.strokeWidth).forEach(d => {
      ctx.beginPath();
      ctx.moveTo(d.sourceNode.pos[0], d.sourceNode.pos[1]);
      ctx.lineTo(d.targetNode.pos[0], d.targetNode.pos[1]);
      ctx.strokeStyle = colorOverride || d.color;
      ctx.lineWidth = d.strokeWidth + strokeWidthOffset;
      ctx.stroke();
    });
  }

  /**
   * Filters links, by giving a list of all the links that are connected in some
   * way to the given nodes.
   * 
   * @param {!Array<string>} featureIds - list of feature ids
   * @return {!Array} - list of filtered links for given nodes
   */
  function filterLinks(featureIds){ 
    const filteredLinks = [];

    featureIds.forEach(nodeId => {
      nodes.filter(n => n.nodeId == nodeId).forEach(node => {
        if (visState.linkType == 'input' || visState.linkType == 'either') {
          Array.prototype.push.apply(filteredLinks, node.sourceLinks);
        }
        if (visState.linkType == 'output' || visState.linkType == 'either') {
          Array.prototype.push.apply(filteredLinks, node.targetLinks);
        }
        if (visState.linkType == 'both') {
          Array.prototype.push.apply(filteredLinks, node.sourceLinks.filter(
            link => visState.pinnedIds.includes(link.sourceNode.nodeId)
          ));
          Array.prototype.push.apply(filteredLinks, node.targetLinks.filter(
            link => visState.pinnedIds.includes(link.targetNode.nodeId)
          ));
        }
      });
    });

    return filteredLinks;
  }

  // Calling drawLinks here will draw all edges, but extremely faintly (5% opacity).
  drawLinks(links, allCtx.allLinks, 0, 'rgba(0,0,0,.05)');
  // renderAll.isShowAllLinks.fns['linkGraph'] = () => c.sel.select('canvas').st({display: visState.isShowAllLinks ? '' : 'none'})

  /**
   * Updates pinned nodes, and highlights all the corresponding connected links.
   * This is called whenever the pinned nodes change.
   */
  function renderPinnedIds(){
    drawLinks(visState.clickedId ? [] : filterLinks(visState.pinnedIds), allCtx.pinnedLinks);
    nodeSel.classed('pinned', d => visState.pinnedIds.includes(d.nodeId));
  }
  renderAll.pinnedIds.fns['linkGraph'] = renderPinnedIds;

  /**
   * Updates hidden nodes, and removes all the corresponding connected links (I think).
   * This is called whenever the hidden nodes change.
   */
  function renderHiddenIds(){
    const hiddenIdSet = new Set(visState.hiddenIds);
    nodeSel.classed('hidden', d => hiddenIdSet.has(d.featureId));
  }
  renderAll.hiddenIds.fns['linkGraph'] = renderHiddenIds;

  /**
   * TODO(mcdougallc) - check if this function is made redundant by `renderPinnedIds`.
   */
  function renderClicked(){
    const clickedLinks = [];
    // if (visState.clickedId) {
    //   clickedLinks = links.filter(link => 
    //     link.sourceNode.nodeId === visState.clickedId || 
    //     link.targetNode.nodeId === visState.clickedId
    //   )
    // } 

    drawLinks(clickedLinks, allCtx.bgLinks, .05, '#000');
    drawLinks(clickedLinks, allCtx.clickedLinks);
    nodeSel.classed('clicked', e => e.nodeId === visState.clickedId);

    drawLinks(visState.clickedId ? [] : filterLinks(visState.pinnedIds), allCtx.pinnedLinks);

    nodeSel
      .at({fill: '#fff'})
      .filter(d => d.tmpClickedLink?.tmpColor)
      .at({fill: d => d.tmpClickedLink.tmpColor})
      .raise();
  }

  renderAll.clickedId.fns['linkGraph'] = renderClicked;
  renderAll.linkType.fns['linkGraph'] = () => {
    renderPinnedIds();
    renderClicked();
  };
  renderAll.hoveredId.fns['linkGraph'] = () => {
    hoverSel.st({display: e => e.featureId == visState.hoveredId ? '' : 'none'});
  };

  // Prepare data for our x-axis tick labels (we don't know exactly which tokens
  // we'll actually be including; some might have been pruned).
  const promptTicks = data.metadata.prompt_tokens.slice(earliestCtxWithNodes-1).map((token, i) =>{
    const ctx_idx = i + earliestCtxWithNodes; 
    const mNodes = nodes.filter(d => d.ctx_idx == ctx_idx);
    const hasEmbed = mNodes.some(d => d.node_type == 'embedding');
    return {token, ctx_idx, mNodes, hasEmbed};
  });

  // Create & position our x-axis tick labels plus other things like vline separators.
  const xTickSel = c.svgBot.appendMany('g.prompt-token', promptTicks)
    .translate(d => [c.x(d.ctx_idx + 1), c.height]);
  
  xTickSel.append('path').at({d: `M0,0v${-c.height}`, stroke: '#fff',strokeWidth: 1});
  xTickSel.filter(d => d.hasEmbed).append('path').at({
    stroke: '#B0AEA6',
    d: `M-${padR + 3.5},${-c.y.bandwidth()/2 + 6}V${8}`,
  });
  xTickSel.filter(d => d.hasEmbed).append('g').translate([-12, 8])
    .append('text').text(d => d.token) 
    .at({
      x: -5,
      y: 2,
      textAnchor: 'end',
      transform: 'rotate(-45)',
      dominantBaseline: 'middle',
      fontSize: 12, // (d, i) => c.x(i+1) - c.x(i) < 15 ? 9 : 14,
    });

  // Do the same thing for logits (i.e. at the end of the graph).
  const logitTickSel = c.svgBot.append('g.axis').appendMany('g', nodes.filter(d => d.node_type == 'logit'))
    .translate(d => d.pos);
  logitTickSel.append('path').at({
    stroke: '#B0AEA6',
    d: `M0,${-6}V${-c.y.bandwidth()/2 - 6}`,
  });
  logitTickSel.append('g').translate([-5, -c.y.bandwidth()/2 - 8])
    .append('text').text(d => d.logitToken) 
    .at({
      x: 5,
      y: 2,
      textAnchor: 'start',
      transform: 'rotate(-45)',
      dominantBaseline: 'middle',
      fontSize: 12, // (d, i) => c.x(i+1) - c.x(i) < 15 ? 9 : 14,
    });

  utilCg.addPinnedClickedGradient(c.svg);
};

window.init?.();

// â”€â”€ init-cg-node-connections.js â”€â”€
/**
 * - Manages the "Node Connections" panel in the attribution graph visualization (top-right).
 * - Displays details about a clicked feature, including its input and output connections.
 * - Input/output features are categorized as 'Positive' or 'Negative' based on link weights.
 * - Dynamically updates the panel content based on user interactions like clicks, hovers, 
 *   pinning, or hiding features.
 * - Relies on `visState` for current visualization state and `renderAll` for coordinating
 *   updates across components.
 *
 * @param {{visState: !Object, renderAll: !Object, data: !Object, cgSel: !d3.Selection}} options
 *   - visState - current visualization state
 *   - renderAll - callback functions for coordinating updates across components
 *   - data - data for the visualization
 *   - cgSel - d3 selection for the node connections panel
 */
window.initCgNodeConnections = function({visState, renderAll, data, cgSel}){

  const nodeConnectionsSel = cgSel.select('.node-connections');
  let headerSel = null;
  let clickedNode = null;
  let featureSel = null;

  /**
   * Main function to render or re-render the contents of the node connections panel.
   * This is called when the clicked node changes or when other state relevant to this panel is updated.
   */
  function render() {
    // Clear previous node connections panel content
    nodeConnectionsSel.html('').st({display: 'flex', flexDirection: 'column'});
    clickedNode = data.nodes.find(e => e.nodeId === visState.clickedId);    
    headerSel = nodeConnectionsSel.append('div.header-top-row.section-title').st({marginBottom: 20}).datum(clickedNode);

    if (!clickedNode) { headerSel.text('Click a feature on the left for details'); return; }

    // Add row with feature icon, title, and toggle behaviour
    addHeaderRow(headerSel); 

    // For each type (input / output) we filter nodes based on the weight of their connection to/from the
    // clicked node, then sort them by their input/output percentage.
    const types = [
      { id: 'input', title: 'Input Features'},
      { id: 'output', title: 'Output Features' }
    ];
    types.forEach(type => type.sections = ['Positive', 'Negative'].map(title => {
      let nodes = data.nodes.filter(d => {
        const weight = type.id === 'input' ? d.tmpClickedSourceLink?.weight : d.tmpClickedTargetLink?.weight;
        return title == 'Positive' ? weight > 0 : weight < 0;
      });
      nodes = d3.sort(nodes, d => -(type.id === 'input' ? d.tmpClickedSourceLink?.pctInput : d.tmpClickedTargetLink?.pctInput));
      return {title, nodes};
    }));

    // Create main container for displaying input / output features side by side, and add a title
    const typesSel = nodeConnectionsSel.append('div.connections')
      .st({flex: '1 0 auto', display: 'flex', overflow: 'hidden', gap: '20px'})
      .appendMany('div.features', types)
      .classed('output', d => d.id === 'output')
      .classed('input', d => d.id === 'input');

    typesSel.append('div.section-title').text(d => d.title)
      .st({marginBottom: 0});
    // addInputSumTable(typesSel.filter(d => d.id == 'input').append('div.sum-table').append('div.section'))

    // Within each of the 2 containers, add rows for the actual effects of neighbouring features
    const featuresContainerSel = typesSel.append('div.effects');
    const sectionSel = featuresContainerSel.appendMany('div.section', d => d.sections);
    featureSel = sectionSel.appendMany('div.feature-row', d => d.nodes)
      .classed('clicked', e => e.featureId == visState.clickedId);

    // Style the rows in the containers specially, if those nodes are pinned or hidden
    classPinned();
    classHidden();

    // This is the function where we actually add the feature row data (it's in utils because we also have to
    // call it after we manually update our autointerp values).
    typesSel.each(function(type) {
      d3.select(this).selectAll('.feature-row')
        .call(utilCg.renderFeatureRow, visState, renderAll, type.id === 'input' ? 'tmpClickedSourceLink' : 'tmpClickedTargetLink');
    });
  }

  // Populates the header row with the feature icon, title, and toggle behaviour
  function addHeaderRow(headerSel){
    if (!clickedNode) return; 

    // Display feature hash, icon for node type, and the title (pretty-printed clerp)
    headerSel.append('text')
      .text(clickedNode.node_type === 'latent' ? 'F#' + d3.format('08')(clickedNode.feature) : ' ')
      .st({display: 'inline-block', marginRight: 5, 'font-variant-numeric': 'tabular-nums', width: 82});
    headerSel.append('span.feature-icon').text(utilCg.featureTypeToText(clickedNode.node_type));
    headerSel.append('span.feature-title').text(clickedNode.ppClerp);

    // Clicking on header row allows you to switch to that feature's view
    headerSel.on('click', ev => {
      utilCg.clickFeature(visState, renderAll, clickedNode, ev.metaKey || ev.ctrlKey);
      if (visState.clickedId) return;
      visState.hoveredId = clickedNode.featureId;
      renderAll.hoveredId();
    });
  }

  /**
   * Adds a table to the node connections panel showing the sum of input feature weights for
   * different categories of input links.
   */
  function addInputSumTable(sumSel){
    return; // TODO(mcdougallc) - re-enable this?

    const clickedNode = data.nodes.idToNode[visState.clickedId];
    if (!clickedNode) return;
    const inputSum = d3.sum(clickedNode.sourceLinks, d => Math.abs(d.weight));

    const tableSel = sumSel.append('table');
    tableSel.appendMany('th', ['% Feat', '% Err', '% Emb']).text(d => d);

    const trSel = tableSel.appendMany('tr.data', [
      {str: 'â†', links: clickedNode.sourceLinks.filter(d => d.sourceNode.ctx_idx != clickedNode.ctx_idx)},
      {str: 'â†“', links: clickedNode.sourceLinks.filter(d => d.sourceNode.ctx_idx == clickedNode.ctx_idx)}
    ]);

    trSel.append('td').text(d => d.str).at({title: d => d.str == 'â†“' ? 'cur token' : 'prev token'});
    trSel.appendMany('td', d => {
        const rv = [
          d.links.filter(e => !e.sourceNode.isError && e.sourceNode.node_type != 'embedding'),
          d.links.filter(e => e.sourceNode.isError),
          d.links.filter(e => e.sourceNode.node_type == 'embedding'),
        ];

        if (rv.flat().length != d.links.length) console.error("Non-feature/error/embedding node present");
        return rv;
      })
      .html(links => {
        const pos = d3.sum(links.filter(d => d.weight > 0), d => d.weight)/inputSum;
        const neg = d3.sum(links.filter(d => d.weight < 0), d => d.weight)/inputSum;

        const outStr = `+${d3.format('.2f')(pos)}&#160;&#160;&#160;âˆ’${d3.format('.2f')(neg)}`;
        return outStr.replaceAll('0.', '.').replaceAll('âˆ’âˆ’', 'âˆ’');
      });
  }

  // Register the main render function & other update functions to be triggered by state changes
  renderAll.hClerpUpdate.fns.push(render);
  renderAll.hoveredId.fns['nodeconnections'] = () => featureSel?.classed('hovered', e => e.featureId == visState.hoveredId);
  renderAll.pinnedIds.fns['nodeconnections'] = classPinned;
  renderAll.hiddenIds.fns['nodeconnections'] = classHidden;
  renderAll.clickedId.fns['nodeconnections'] = render;

  // Functions to update styling of feature rows if those nodes are pinned or hidden
  function classPinned(){
    const pinnedIdSet = new Set(visState.pinnedIds);
    featureSel?.classed('pinned', d => pinnedIdSet.has(d.nodeId));
    headerSel?.classed('pinned', d => d && d.nodeId && visState.pinnedIds.includes(d.nodeId))
      .select('span.feature-title').text(d => d.ppClerp);
  }
  function classHidden(){
    const hiddenIdSet = new Set(visState.hiddenIds);
    featureSel?.classed('hidden', d => hiddenIdSet.has(d.featureId));
  }
};

// â”€â”€ init-cg-subgraph.js â”€â”€
/**
 * - Initializes and manages an interactive D3.js visualization of a control flow subgraph.
 * - Handles user interactions like node selection, grouping (supernodes), and dragging.
 * - Implements dynamic layout using D3 force simulation and an optional Dagre-based layout.
 * - Dynamically styles nodes and links based on their state and properties.
 * - Integrates with a larger visualization system through `visState` and `renderAll`.
 *
 * @param {{visState: !Object, renderAll: !Object, data: !Object, cgSel: !d3.Selection}} options
 *   - visState - current visualization state
 *   - renderAll - callback functions for coordinating updates across components
 *   - data - the graph data (nodes, links, metadata)
 *   - cgSel - d3 selection of the parent container for the subgraph
 */
window.initCgSubgraph = function ({visState, renderAll, data, cgSel}) {
  // Attach function to resize subgraph if container is resized
  const subgraphSel = cgSel.select('.subgraph');
  subgraphSel.datum().resizeFn = renderSubgraph;

  // Data structures to store graph elements & simulation state
  let nodeIdToNode = {};
  let sgNodes = [];
  let sgLinks = [];

  let nodeSel = null;
  let memberNodeSel = null;
  let simulation = null;

  const nodeWidth = 75;
  const nodeHeight = 25;

  // TODO(mcdougallc) - re-enable this function, allowing for super node state
  // to be persisted in the URL and hence sent to other people as a url.
  function supernodesToUrl() {
    // util.params.set('supernodes', JSON.stringify(subgraphState.supernodes))
  }

  // Initialize subgraph state from the global visState
  const subgraphState = visState.subgraph = visState.subgraph || {
    sticky: true, // should nodes stay in place after dragging?
    dagrefy: true, // should dagre layout be applied internally?
    supernodes: visState.supernodes || [], // defn & contents of supernodes
    activeGrouping: { // currently selected node groups
      isActive: false,
      selectedNodeIds: new Set(),
    }
  };

  // Set up global key listeners for initiating and finalizing node grouping.
  // These listeners are namespaced with `data.metadata.slug` to avoid conflicts
  // if multiple instances of this visualization exist on the same page.
  d3.select('body')
    .on('keydown.grouping' + data.metadata.slug, ev => {
      if (ev.repeat) return;
      // Pressing `g` in edit mode activates grouping
      if (!visState.isEditMode || ev.key != 'g') return;
      subgraphState.activeGrouping.isActive = true;
      styleNodes();

      subgraphSel.classed('is-grouping', true);
    })
    .on('keyup.grouping' + data.metadata.slug, ev => {
      // Releasing `g` in edit mode finalizes grouping
      if (!visState.isEditMode || ev.key != 'g') return;

      // If multiple nodes are selected when `g` is released, create a supernode.
      if (subgraphState.activeGrouping.selectedNodeIds.size > 1){
        let allSelectedIds = [];
        let prevSupernodeLabel = '';

        // Collect all selected nodes (expanding any selected supernodes into their member nodes).
        subgraphState.activeGrouping.selectedNodeIds.forEach(id => {
          let node = nodeIdToNode[id];
          if (!node?.memberNodeIds) return allSelectedIds.push(id);
          prevSupernodeLabel = node.ppClerp;

          // If a supernode is selected, remove the previous super node - this allows for the
          // re-grouping or merging of supernodes.
          subgraphState.supernodes = subgraphState.supernodes.filter(([label, ...nodeIds]) =>
            !nodeIds.every(d => node.memberNodeIds.includes(d))
          );
          node.memberNodeIds.forEach(id => allSelectedIds.push(id));
        });

        // Get the label for the new supernode - by default this is the label of the previous
        // supernode, or if none then take the label of the first selected node.
        const label = prevSupernodeLabel || allSelectedIds
          .map(id => nodeIdToNode[id]?.ppClerp)
          .find(d => d) || 'supernode';
        // Add new supernode defn to state, and update URL (if enabled).
        subgraphState.supernodes.push([label, ...new Set(allSelectedIds)]);
        supernodesToUrl();
      }
      // Reset grouping node state (so the next grouping session starts clean).
      subgraphState.activeGrouping.isActive = false;
      subgraphState.activeGrouping.selectedNodeIds.clear();

      // Re-render subgraph to reflect changes.
      renderSubgraph();

      subgraphSel.classed('is-grouping', false);
    });

  // Destructure data (this is nodes & links for the entire graph, not just the subgraph).
  let {nodes, links} = data;

  /**
   * Render the subgraph. This function is called whenever the data or visState
   * changes; it populates the subgraph with nodes & links and handles all
   * positioning & styling.
   */
  function renderSubgraph() {
    const c = d3.conventions({
      sel: subgraphSel.html(''),
      margin: {top: 26, bottom: 5, left: visState.isHideLayer ? 0 : 30},
      layers: 'sd',
    });
    // subgraphSel.st({borderTop: '1px solid #eee'})

    c.svg.append('text.section-title').text('Subgraph').translate(-16, 1);
    c.svg.append('g.border-path').append('path')
      .at({stroke: '#eee', d: 'M 0 -10 H ' + c.width});

    const [svg, div] = c.layers;

    // // set up arrowheads, different for positive vs negative
    // svg.appendMany('marker', [{id: 'mid-negative', color: '#40004b'},{id: 'mid-positive', color: '#00441b'}])
    //   .at({id: d => d.id, orient: 'auto', refX: .1, refY: 1}) // marker-height/marker-width?
    //   .append('path')
    //   .at({d: 'M0,0 V2 L1,1 Z', fill: d => d.color})

    nodes.forEach(d => d.supernodeId = null);
    // Filter out pinned nodes to the first 200, to avoid rendering too many nodes.
    const pinnedIds = visState.pinnedIds.slice(0, 200); // max of 200 nodes
    let pinnedNodes = nodes.filter(d => pinnedIds.includes(d.nodeId));

    // Create lookup map from nodeId to node object
    nodeIdToNode = Object.fromEntries(pinnedNodes.map(d => [d.nodeId, d]));

    // Create supernode objects, each one containing a list of member nodes
    const supernodes = subgraphState.supernodes
      .map(([label, ...nodeIds], i) => {
        const nodeId = nodeIdToNode[label] ? `supernode-${i}` : label;

        // Tag each member node which is inside this supernode.
        const memberNodes = nodeIds.map(id => nodeIdToNode[id]).filter(d => d);
        memberNodes.forEach(d => d.supernodeId = nodeId);

        // Create the supernode object. These properties are derived from aggregating over the
        // member nodes, they include things like `layer` (an average, for y-positioning) and
        // `ppLayer` (a string showing range of layers, for display).
        const rv = {
          nodeId,
          featureId: `supernode-${i}`,
          ppClerp: label,
          layer: d3.mean(memberNodes, d => +d.layer),
          ctx_idx: d3.mean(memberNodes, d => d.ctx_idx),
          ppLayer: d3.extent(memberNodes, d => +d.layer).join('â€”'),
          streamIdx: d3.mean(memberNodes, d => d.streamIdx),
          memberNodeIds: nodeIds,
          memberNodes,
          isSuperNode: true,
        };
        nodeIdToNode[rv.nodeId] = rv;

        return rv;
      })
      .filter(d => d.memberNodes.length);

    // Update the clerp descriptions, by prefixing them with their supernode label.
    // TODO(mcdougallc) - this is a fragile hack if hClerpUpdate changes, should improve.
    nodes.forEach(d => d.ppClerp = d.clerp);
    supernodes.forEach(({ppClerp, memberNodes}) => {
      if (memberNodes.length == 1 && ppClerp == memberNodes[0].ppClerp) return;
      memberNodes.forEach(d => {
        d.ppClerp = `[${ppClerp}]` + (ppClerp != d.ppClerp ? ' ' + d.ppClerp : '');
      });
    });

    // Calculate properties for nodes related to their connections (especially those
    // external to the supernode).
    pinnedNodes.forEach(d => {
      d.inputAbsSumExternalSn = d3.sum(d.sourceLinks, e => {
        if (!e.sourceNode.supernodeId) return Math.abs(e.weight);
        return e.sourceNode.supernodeId == d.supernodeId ? 0 : Math.abs(e.weight);
      });
      d.sgSnInputWeighting = d.inputAbsSumExternalSn/d.inputAbsSum;
    });

    // Get a list of all the objects in our supernode subgraph: this means the supernodes and
    // all the pinned nodes which are not in a supernode.
    sgNodes = pinnedNodes.filter(d => !d.supernodeId).concat(supernodes);
    sgNodes.forEach(d => {
      if (d.isSuperNode) {
        d.inputAbsSum = d3.sum(d.memberNodes, e => e.inputAbsSum);
        d.inputAbsSumExternalSn = d3.sum(d.memberNodes, e => e.inputAbsSumExternalSn);
      } else {
        d.memberNodes = [d];
      }
      const sum = d3.sum(d.memberNodes, e => e.sgSnInputWeighting);
      d.memberNodes.forEach(e => e.sgSnInputWeighting = e.sgSnInputWeighting/sum);
    });

    // Filter and process links for this subgraph. We only include links where both source and
    // target are in the subgraph, i.e. in `nodeIdToNode`.
    sgLinks = links
      .filter(d => nodeIdToNode[d.sourceNode.nodeId] && nodeIdToNode[d.targetNode.nodeId])
      .map(d => ({
        source: d.sourceNode.nodeId,
        target: d.targetNode.nodeId,
        weight: d.weight,
        color: d.pctInputColor,
        ogLink: d,
      }));

    // Remap source/target links to links between supernodes, and aggregate their weights (so
    // we just have a single link for each pair of `sgNodes`), this involves combining parallel
    // links and removing self-links.
    sgLinks.forEach(link => {
      if (nodeIdToNode[link.source]?.supernodeId) link.source = nodeIdToNode[link.source].supernodeId;
      if (nodeIdToNode[link.target]?.supernodeId) link.target = nodeIdToNode[link.target].supernodeId;
    });
    sgLinks = d3.nestBy(sgLinks, d => d.source + '-' + d.target)
      .map(links => {
        const weight = d3.sum(links, link => {
          const {inputAbsSumExternalSn, sgSnInputWeighting} = link.ogLink.targetNode;
          return link.weight/inputAbsSumExternalSn*sgSnInputWeighting;
        });

        return {
          source: links[0].source,
          target: links[0].target,
          weight,
          color: utilCg.pctInputColorFn(weight),
          pctInput: weight,
          pctInputColor: utilCg.pctInputColorFn(weight),
          ogLinks: links
        };
      })
      .filter(d => d.source !== d.target);
    sgLinks = d3.sort(sgLinks, d => Math.abs(d.weight));

    // Define scales for positioning supernodes (like in the main graph, ctx_idx is x and layer is y).
    let xScale = d3.scaleLinear()
      .domain(d3.extent(sgNodes.map(d => d.ctx_idx)))
      .range([0, c.width*3/4]);
    let yScale = d3.scaleLinear()
      .domain(d3.extent(sgNodes.map(d => d.streamIdx)).toReversed())
      .range([0, c.height - nodeHeight]);

    // Prepare nodes for the D3 force simulation.
    // We use a copy of the nodes to avoid mutating the originals, and we also persist their positions
    // across node changes (hence the inheritance of positions from `existingNodes`).
    const existingNodes = window.selForceNodes && new Map(window.selForceNodes.map(n => [n.node.nodeId, n]));
    window.selForceNodes = sgNodes.map(node => {
      const existing = existingNodes?.get(node.nodeId);
      return {
        x: existing ? existing.x : xScale(node.ctx_idx),
        y: existing ? existing.y : yScale(node.streamIdx),
        fx: existing?.fx,
        fy: existing?.fy,
        nodeId: node.nodeId, // for addFeatureEvents
        featureId: node.featureId, // for addFeatureEvents
        node,
        sortedSlug: d3.sort(node.memberNodes.map(d => d.featureIndex).join(' ')),
      };
    });

    // Sort nodes by their sortedSlug, so order is consistent across reloads.
    const selForceNodes = window.selForceNodes = d3.sort(window.selForceNodes, d => d.sortedSlug);
    window._exportSubgraphPos = function(){
      return selForceNodes.map(d => [d.x/c.width*1000, d.y/c.height*1000].map(Math.round)).flat().join(' ');
    };

    // Initialize the D3 force simulation
    if (simulation) simulation.stop();
    simulation = d3.forceSimulation(selForceNodes)
      .force('link', d3.forceLink(sgLinks).id(d => d.node.nodeId)) // attractive force between nodes
      .force('charge', d3.forceManyBody()) // repulsive force between nodes
      .force('collide', d3.forceCollide(Math.sqrt(nodeHeight ** 2 + nodeWidth ** 2) / 2)) // prevents overlap
      .force('container', forceContainer([[-10, 0], [c.width - nodeHeight, c.height - nodeHeight]])) // keeps within container
      // `forceX` and `forceY` gently pull nodes towards their ideal positions based on `xScale` and `yScale`,
      // helping maintain a semblance of the original data structure while allowing force layout.
      .force('x', d3.forceX(d => xScale(d.node.ctx_idx)).strength(.1))
      .force('y', d3.forceY(d => yScale(d.node.streamIdx)).strength(2));

    // Render the links (edges) as SVG paths, stylized by their weight.
    const svgPaths = svg.appendMany('path.link-path', sgLinks).at({
      fill: 'none',
      markerMid: d => d.weight > 0 ? 'url(#mid-positive)' : 'url(#mid-negative)',
      strokeWidth: d => Math.abs(d.weight)*15,
      stroke: d => d.color,
      opacity: 0.8,
      strokeLinecap: 'round',
    });

    // Add text labels for edge weights; TODO(mcdougallc) add this back in
    const edgeLabels = svg.appendMany('text.weight-label', sgLinks);
      // .text(d => d3.format('+.2f')(d.weight))

    // Register the `renderForce` fn to be called on every tick of the sim.
    simulation.on('tick', renderForce);

    // Define drag behaviour for nodes: once you start dragging the dagre posn
    // is reset, and at each tick we update the node's position and apply graph
    // force based on these positions.
    const drag = d3.drag()
      .on('drag', (ev) => {
        // Only when actually dragging, mark as no longer dagre positioned and restart sim
        ev.subject.dagrePositioned = false;
        if (!ev.active) simulation.alphaTarget(0.3).restart();
        ev.subject.fx = ev.subject.x = ev.x;
        ev.subject.fy = ev.subject.y = ev.y;
        renderForce();
      })
      .on('end', (ev) => {
        if (!ev.active) simulation.alphaTarget(0);
        if (!subgraphState.sticky && !ev.subject.dagrePositioned){
          ev.subject.fx = null;
          ev.subject.fy = null;
        }
      });

    // Create div elements for each node in `selForceNodes`, and add click
    // behaviour to select/deselect them.
    nodeSel = div
      .appendMany('div.supernode-container', selForceNodes)
      .translate(d => [d.x, d.y])
      .st({width: nodeWidth, height: nodeHeight})
      .call(utilCg.addFeatureEvents(visState, renderAll, ev => ev.shiftKey))
      .on('click.group', (ev, d) => {
        const {isActive, selectedNodeIds} = subgraphState.activeGrouping;
        if (!isActive) return;

        // If it's a child node, use its parent supernode's ID instead
        const nodeId = d.supernodeId || d.nodeId;
        selectedNodeIds.has(nodeId) ? selectedNodeIds.delete(nodeId) : selectedNodeIds.add(nodeId);

        styleNodes();
        ev.stopPropagation(); // Prevent click from bubbling to other elems
        ev.preventDefault();
      })
      .call(drag); // Give node the drag behaviour defined above

    // Give each node a `memberNodes` array, by default just itself but this is
    // what gets used when we assemble nodes into supernodes.
    selForceNodes.forEach(d => {
      if (!d.node.memberNodes) d.node.memberNodes = [d.node];
    });

    // Style the supernode container: this means putting all the supernodes in a
    // box and giving the nodes inside that box circles. The width of the
    // supernode box is based on the number of circles.
    const supernodeSel = nodeSel //.filter(d => d.node.isSuperNode)
      .classed('is-supernode', true)
      .st({height: nodeHeight + 12});

    memberNodeSel = supernodeSel.append('div.member-circles')
      .st({
        // Compact display: the more nodes there are, the tighter we pack them
        width: d => d.node.memberNodes.length <= 4 ? 'auto' : 'calc(32px + 12px)', 
        gap: d => d.node.memberNodes.length <= 4 ? 4 : 0,
      })
      .appendMany('div.member-circle', d => d.node.memberNodes)
      .classed('not-clt-feature', d => d.node_type != 'latent')
      .st({marginLeft: function(d, i) {
        // Also if there are enough nodes (>=4), we stack them horizontally
        const n = this.parentNode.childNodes.length;
        return n <= 4 ? 0 : i == 0 ? 0 : -((n - 4)*8)/(n - 1);
      }})
      // Circles get standard feature events too (just like normal nodes)
      .call(utilCg.addFeatureEvents(visState, renderAll, ev => ev.shiftKey))
      .on('click.stop-parent', ev => {
        // If grouping is active, stop the click from bubbling to other elems
        // (since we only want it to apply to this supernode).
        if (!subgraphState.activeGrouping.isActive) ev.stopPropagation();
      })  
      .on('mouseover.stop-parent', ev => ev.stopPropagation())
      .at({title: d => d.ppClerp});

    // If edit mode is enabled, add an "ungroup" button to supernodes.
    // TODO(mcdougallc) - try enabling this
    if (visState.isEditMode) {
      supernodeSel.select('.member-circles')
        .filter(d => d.node.isSuperNode)
        .append('div.ungroup-btn')
        .text('Ã—').st({top: 2, left: -15, position: 'absolute'})
        .on('click', (ev, d) => {
          ev.stopPropagation();
          // Delete this supernode from the supernode list in `subgraphState`
          subgraphState.supernodes = subgraphState.supernodes.filter(([label, ...nodeIds]) =>
            !nodeIds.every(id => d.node.memberNodeIds.includes(id))
          );
          supernodesToUrl();
          renderSubgraph();
        });
    }

    // Add a container for the node text (i.e. a label)
    const nodeTextSel = nodeSel.append('div.node-text-container');
    nodeTextSel.append('span')
      .text(d => d.node.ppClerp)
      .on('click', (ev, d) => {
        // Allow editing of supernode labels on click
        if (!visState.isEditMode) return;
        if (!d.node.isSuperNode) return;
        // TODO(mcdougallc) - remove the `return` below?
        return;
        ev.stopPropagation();

        // Logic for in-place editing: hide span, show input, save on Enter
        const spanSel = d3.select(ev.target).st({display: 'none'});
        const input = d3.select(spanSel.node().parentNode).append('input')
          .at({class: 'temp-edit', value: spanSel.text()})
          .on('blur', save)
          .on('keydown', ev => {
            if (ev.key === 'Enter'){
              save();
              input.node().blur();
            }
            ev.stopPropagation();
          });

        input.node().focus();

        // The saving on Enter updates the supernode in `subgraphState`
        function save(){
          const idx = subgraphState.supernodes.findIndex(([label, ...nodeIds]) =>
            nodeIds.every(id => d.node.memberNodeIds.includes(id))
          );
          if (idx >= 0){
            subgraphState.supernodes[idx][0] = input.node().value || 'supernode';
            supernodesToUrl();
            renderSubgraph();
          }
        }
      });

    // Calculate height of the text container for each node, so we can position
    // the edge labels correctly.
    nodeTextSel.each(function(d) {
      d.textHeight = this.getBoundingClientRect().height || -8;
    });
    nodeSel.append('div.clicked-weight.source');
    nodeSel.append('div.clicked-weight.target');
    styleNodes();

    // Define checkbox options for UI controls (e.g. sticky, Dagre layout).
    const checkboxes = Object.entries({
      sticky: () => {
        // simulation.alphaTarget(0.3).restart()
        if (!subgraphState.sticky) unsticky();
      },
      dagrefy: () => {
        subgraphState.dagrefy ? dagrefy() : selForceNodes.forEach(d => d.dagrePositioned = null);
      },
    }).map(([key, fn]) => ({key, fn}));

    // Create & manage checkboxes for UI controls.
    // TODO(mcdougallc) - try enabling this.
    if (visState.isEditMode && false) {
      div.append('div.checkbox-container').translate([-c.margin.left, c.margin.bottom])
        .appendMany('label', checkboxes).append('input')
        .at({type: 'checkbox'})
        .property('checked', d => subgraphState[d.key])
        .on('change', function(ev, d){
          subgraphState[d.key] = this.checked;
          d.fn();
        })
        .parent().append('span').text(d => d.key);
    }

    checkboxes.forEach(d => d.fn());

    /**
     * Function to unfix all node posns, allowing the force simulation to move
     * them again. This is called when `sticky` mode is turned off.
     */
    function unsticky(){
      selForceNodes.forEach(d => (d.fx = d.fy = null));
      simulation.alphaTarget(0.3).restart();
      if (subgraphState.dagrefy) {
        subgraphState.dagrefy = false;
        d3.select('.checkbox-container').selectAll('input').filter(d => d.key == 'dagrefy').property('checked', 0);
        checkboxes.find(d => d.key == 'dagrefy').fn();
      }
    }

    /**
     * Function to apply layout using the Dagre library (graph layout alg), this
     * is an alternative to the D3 force layout. It populates the `fx` and `fy`
     * properties of each node with their calculated positions, and then 
     * triggers a re-render.
     */
    function dagrefy(){
      if (visState.sg_pos){
        const nums = visState.sg_pos.split(' ').map(d => +d);
        selForceNodes.forEach((d, i) => {
          d.fx = d.x = nums[i*2 + 0]/1000*c.width;
          d.fy = d.y = nums[i*2 + 1]/1000*c.height;
        });

        nodeSel.translate(d => [d.x, d.y]);
        styleNodes();
        renderEdges();

        visState.og_sg_pos = visState.sg_pos;
        delete visState.sg_pos;
      }
      if (visState.og_sg_pos) return;

      const g = new window.dagre.graphlib.Graph();
      g.setGraph({rankdir: 'BT', nodesep: 20, ranksep: 20});
      g.setDefaultEdgeLabel(() => ({}));

      sgLinks.forEach(d =>{
        if (Math.abs(d.weight) < .003) return;
        // set width and height to make dagre return x and y for edges
        g.setEdge(d.source.nodeId, d.target.nodeId, {width: 1, height: 1, labelpos: 'c', weight: Math.abs(d.weight)});
      });
      sgNodes.forEach(d => {
        g.setNode(d.nodeId, {width: nodeWidth, height: nodeHeight});
      });

      window.dagre.layout(g);

      // rescale to fit container
      const xs = d3.scaleLinear([0, g.graph().width], [0, Math.min(c.width, g.graph().width)]);
      const ys = d3.scaleLinear([0, g.graph().height], [0, Math.min(c.height, g.graph().height)]);

      // flip to make ctx_idx left to right and streamIdx bottom to top
      let w0 = d3.mean(selForceNodes, d =>  g.node(d.nodeId).x*d.node.ctx_idx);
      let w1 = d3.mean(selForceNodes, d => -g.node(d.nodeId).x*d.node.ctx_idx);
      if (w0 < w1) xs.range(xs.range().reverse());

      w0 = d3.mean(selForceNodes, d => g.node(d.nodeId).y*d.node.streamIdx);
      w1 = d3.mean(selForceNodes, d => -g.node(d.nodeId).y*d.node.streamIdx);
      if (w0 < w1) ys.range(ys.range().reverse());

      for (const node of window.selForceNodes) {
        const pos = g.node(node.nodeId);
        node.fx = node.x = xs(pos.x) - nodeWidth/2;
        node.fy = node.y = ys(pos.y) - nodeHeight/2;
        node.dagrePositioned = true;
      }

      // const curveFactory = d3.line(d => d.x, d => d.y).curve(d3.curveBasis)
      // svgPaths.at({d: d => {
      //   const points = g.edge(d.source.nodeId, d.target.nodeId)?.points
      //   if (!points) return ''
      //   return curveFactory(points.map(p => ({x: xs(p.x), y: ys(p.y)})))
      // }})
      renderEdges();

      // edgeLabels.translate(d => {
      //   const pos = g.edge(d.source.nodeId, d.target.nodeId)
      //   if (!pos) return [-100, -100]
      //   return [xs(pos.x), ys(pos.y)]
      // })
      styleNodes();
    }

    /**
     * Function called on each tick of the D3 force simulation, updating node & edge posns.
     */
    function renderForce(){
      nodeSel.translate(d => [d.x, d.y]);

      renderEdges();

      edgeLabels
        .filter(d => !(d.source.dagrePositioned && d.target.dagrePositioned))
        .translate(d => [
          (d.source.x + d.target.x) / 2 + nodeWidth / 2,
          (d.source.y + d.target.y) / 2 + nodeHeight / 2
        ]);
    }

    /**
     * Function called on each tick, to update visual representation of edges.
     */
    function renderEdges(){

      // TODO(mcdougallc) - use actual strokeWidth to spread
      d3.nestBy(sgLinks, d => d.source).forEach(links => {
        // if (links[0].source.nodeId == '6_12890134_-0') debugger
        const numSlots = links[0].source.node.memberNodes.length;
        const totalWidth = (Math.min(4, numSlots))*8;
        d3.sort(links, d => Math.atan2(d.target.y - d.source.y, d.target.x - d.source.x))
          .forEach((d, i) => d.sourceOffsetX = (i - links.length/2)*totalWidth/links.length);
      });

      d3.nestBy(sgLinks, d => d.target).forEach(links => {
        const numSlots = links[0].target.node.memberNodes.length;
        const totalWidth = (Math.min(4, numSlots) + 1)*3;
        d3.sort(links, d => -Math.atan2(d.source.y - d.target.y, d.source.x - d.target.x))
          .forEach((d, i) => d.targetOffsetX = (i - links.length/2)*totalWidth/links.length);
      });

      svgPaths.at({
        d: d => {
          const x0 = d.source.x + nodeWidth/2 + d.sourceOffsetX;
          const y0 = d.source.y; 
          const x1 = d.target.x + nodeWidth/2 + d.targetOffsetX;
          const y1 = d.target.y + d.target.textHeight + 28;
          return `M${x0},${y0} L${x1},${y1}`;
        },
      });
    }
  }

  /**
   * Function to update visual styling of nodes & links based on their current
   * state (e.g. clicked, hovered, selected for grouping). 
   */
  function styleNodes() {
    if (!nodeSel) return;

    // Style nodes (this includes z-index, so the selected node is on top of the
    // other nodes in its supernode).
    nodeSel
      .classed('clicked', d => d.nodeId == visState.clickedId)
      .classed('hovered', d => d.featureId == visState.hoveredId)
      .st({zIndex: d => Math.round(d.x*20 + d.y) + 1000})
      .classed('grouping-selected', d => subgraphState.activeGrouping.selectedNodeIds.has(d.nodeId));

    // Style member circles within supernodes (similar to how nodes are styled).
    memberNodeSel
      .classed('clicked', d => d.nodeId == visState.clickedId)
      .classed('hovered', d => d.featureId == visState.hoveredId)
      .st({
        background: d => d.tmpClickedLink?.pctInputColor,
        color: d => utilCg.bgColorToTextColor(d.tmpClickedLink?.pctInputColor)
      });
      // .at({title: d => d3.format('.1%')(d.tmpClickedLink?.pctInput)})

    // Highlight links connected to a clicked node (we do this by taking the
    // clicked node & iterating through subgraph to find all connecting links).
    sgNodes.forEach(d => {
      d.tmpClickedSgSource = d.tmpClickedLink?.sourceNode == d ? d.tmpClickedLink : null;
      d.tmpClickedSgTarget = d.tmpClickedLink?.targetNode == d ? d.tmpClickedLink : null;
    });
    if (visState.clickedId) {
      sgLinks.forEach(d => {
        if (d.source.nodeId == visState.clickedId) nodeIdToNode[d.target.nodeId].tmpClickedSgTarget = d;
        if (d.target.nodeId == visState.clickedId) nodeIdToNode[d.source.nodeId].tmpClickedSgSource = d;
      });
    }

    // nodeSel.selectAll('.clicked-weight.source')
    //   .st({display: d => d.node.tmpClickedSgSource ? '' : 'none'})
    //   .filter(d => d.node.tmpClickedSgSource)
    //   .text(d => d3.format('.1%')(d.node.tmpClickedSgSource.pctInput))
    //   .st({
    //     background: d => d.node.tmpClickedSgSource.pctInputColor,
    //     color: d => utilCg.bgColorToTextColor(d.node.tmpClickedSgSource.pctInputColor)
    //   })

    // nodeSel.selectAll('.clicked-weight.target')
    //   .st({display: d => d.node.tmpClickedSgTarget ? '' : 'none'})
    //   .filter(d => d.node.tmpClickedSgTarget)
    //   .text(d => d3.format('.1%')(d.node.tmpClickedSgTarget.pctInput))
    //   .st({
    //     background: d => d.node.tmpClickedSgTarget.pctInputColor,
    //     color: d => utilCg.bgColorToTextColor(d.node.tmpClickedSgTarget.pctInputColor)
    //   })
  }

  // Make sure subgraph is re-rendered when certain parts of visState change.
  renderAll.hClerpUpdate.fns['subgraph'] = renderSubgraph;
  renderAll.pinnedIds.fns['subgraph'] = renderSubgraph;
  renderAll.clickedId.fns['subgraph'] = styleNodes;
  renderAll.hoveredId.fns['subgraph'] = styleNodes;

  // Custom D3 force to keep nodes within specified bounding box. This is based
  // on the d3-force-container library:
  // https://github.com/1wheel/d3-force-container/blob/master/src/force-container.js
  function forceContainer(bbox) {
    let nodes, strength = 1;

    function force(alpha) {
      let i,
          n = nodes.length,
          node,
          x = 0,
          y = 0;

      for (i = 0; i < n; ++i) {
        node = nodes[i], x = node.x, y = node.y;

        if (x < bbox[0][0]) node.vx += (bbox[0][0] - x)*alpha;
        if (y < bbox[0][1]) node.vy += (bbox[0][1] - y)*alpha;
        if (x > bbox[1][0]) node.vx += (bbox[1][0] - x)*alpha;
        if (y > bbox[1][1]) node.vy += (bbox[1][1] - y)*alpha;
      }
    }

    force.initialize = function(_){
      nodes = _;
    };

    force.bbox = function(_){
      return arguments.length ? (bbox = +_, force) : bbox;
    };
    force.strength = function(_){
      return arguments.length ? (strength = +_, force) : strength;
    };

    return force;
  }
};
